import { Schema, Types, model} from "mongoose";
import bcrypt from 'bcryptjs';

const userSchema = new Schema({
    nombre:{
        type:String,
        trim:true
    },
    primerApellido:{
        type:String,
        trim:true
    },
    segundoApellido:{
        type:String,
        trim:true
    },
    grado:{
        type:String,
        trim:true
    },
    matricula:{
        type:String,
        trim:true
    },
    grupo:{
        type:String,
        trim:true
    },
    turno:{
        type:String,
        trim:true
    },
    email:{
        type:String,
        trim:true
    },
    contrasea:{
        type:String,
        trim:true
    },
    licAsig:{
        type:String,
        trim:true
    },
    gradoAsig:{
        type:String,
        trim:true
    },
    grupoAsig:{
        type:String,
        trim:true
    },
    turnoAsig:{
        type:String,
        trim:true
    },
    claveC:{
        type:String,
        trim:true
    },
    
    claveO:{
        type:String,
        trim:true
    },
    
    claveT:{
        type:String,
        trim:true
    },
    roles:[{
        ref:"Role",
        type:Schema.Types.String
    }],
    licenciatura:[{
        ref:"Licenciatura",
        type:Schema.Types.String
    }],
    config:[{
        ref:"Config",
        type:Schema.Types.String
    }]
},{
    timestamps:true,
    versionKey:false,

});
//Metodo para encriptar la contrasea
userSchema.statics.encryptContrasea = async (contrasea) => {
const salt = await bcrypt.genSalt(10)
return await bcrypt.hash(contrasea,salt)
}
//Metodo para comparar la contrasea
userSchema.statics.compareContrasea =  async(contrasea,receivedContrasea) =>{
   return await bcrypt.compare(contrasea,receivedContrasea)
}
export default 
model('User',userSchema);

