import User from '../models/User'
import jwt, { sign } from 'jsonwebtoken'
import config from '../config'
import Role from '../models/Role';



//Metodos 'Registro Alumno'
export const signUp=async (req,res)=>{
     res.render('registroA');   
}
export const signup=async (req,res)=>{
const {nombre,primerApellido,segundoApellido,licenciatura,grado,matricula,grupo,turno,email,contrasea,roles}= req.body;
//Crea un objeto de tipo 'User' 
const newUser = new User({
     nombre,
     primerApellido,
     segundoApellido,
     licenciatura,
     grado,
     matricula,
     grupo,
     turno,
     email,
     contrasea: await User.encryptContrasea(contrasea)
})
if (roles){
     const foundRoles =  await Role.find({name:{$in: roles}})
     newUser.roles= foundRoles.map(role=> role._id)
}else{
     const role = await Role.findOne({name:'alumno'})
     newUser.roles=[role._id] 
}
//Se guarda el nuevo usuario en la BD
const saveUser= await newUser.save();

const token= jwt.sign({id: saveUser},config.SECRET,{
     expiresIn:86400
})
res.status(200).json({token})

console.log(saveUser);
 res.render('registroA')
}
//Metodos 'Registro Coordinador'
export const registroC=async (req,res)=>{
     res.render('registroC');   
}
export const registroc=async (req,res)=>{
const {nombre,primerApellido,segundoApellido,email,contrasea,roles}= req.body;
const newUser = new User({
     nombre,
     primerApellido,
     segundoApellido,
     email,
     contrasea: await User.encryptContrasea(contrasea)
})
if (roles){
     const foundRoles =  await Role.find({name:{$in: roles}})
     newUser.roles= foundRoles.map(role=> role._id)
}else{
     const role = await Role.findOne({name:'coordinador'})
     newUser.roles=[role._id] 
}
const saveUser= await newUser.save();
const token=jwt.sign({id:saveUser},config.SECRET,{
     expiresIn:86400     
})
res.status(200).json({token})
 res.render('registroC')
}
//Metodos 'Registro Orientador'
export const registroO=async (req,res)=>{
     res.render('registroO');   
}
export const registroo=async (req,res)=>{
const{nombre,primerApellido,segundoApellido,licAsig,gradoAsig,grupoAsig,turnoAsig,email,contrasea,roles}= req.body;
//const userFound= User.find({email})
const newUser = new User({
     nombre,
     primerApellido,
     segundoApellido,
     licAsig,
     gradoAsig,
     grupoAsig,
     turnoAsig,
     email,
     contrasea: await User.encryptContrasea(contrasea)
})
if (roles){
     const foundRoles =  await Role.findOne({name:{$in: roles}})
     newUser.roles= foundRoles.map(role=> role._id)
}else{
     const role = await Role.findOne({name:'orientador'})
     newUser.roles=[role._id] 
}
const saveUser= await newUser.save();
console.log(saveUser);
 res.render('registroO')
}
//Metodos 'Registro Tutor'
export const registroT=async (req,res)=>{
     res.render('registroT');   
}
export const registrot=async (req,res)=>{
const{nombre,primerApellido,segundoApellido,licAsig,gradoAsig,grupoAsig,turnoAsig,email,contrasea,roles}= req.body;
const newUser = new User({
     nombre,
     primerApellido,
     segundoApellido,
     licAsig,
     turnoAsig,
     email,
     contrasea: await User.encryptContrasea(contrasea)
})
if (roles){
     const foundRoles =  await Role.find({name:{$in: roles}})
     newUser.roles= foundRoles.map(role=> role._id)
}else{
     const role = await Role.findOne({name:'tutor'})
     newUser.roles=[role._id] 
}
const saveUser= await newUser.save();
console.log(saveUser);
 res.render('registroT')
}



export const signIn=async (req,res)=>{
     res.render('iniciarSesion');   
}


export const signin = async (req,res)=>{

const userFound = await User.findOne({email:req.body.email}).populate("roles");
 
if (!userFound) return res.status(400).json({message:"user not found"});


 const matchContrasea = await User.compareContrasea(req.body.contrasea,userFound.contrasea)



 
const token=jwt.sign({id: userFound._id},config.SECRET,{
     expiresIn:86400
})
 res.render('listaUsers'); res.json({ token });

}

