//Get
usersCtrl.renderSignin =
    (req,res)=>{
        res.render('/iniciarSesion');
}

//Post


usersCtrl.Signin=async (req,res)=>{
    const inicioS = InicioSesion(req.body)
    await inicioS.save();
    res.send('save') ;
}

