import Licenciatura from "../models/Licenciatura";
import Role from "../models/Role";

export const createLicenciaturas = async () => {
  try {
    const count = await Licenciatura.estimatedDocumentCount();
    if (count > 0) return;
    const values = await Promise.all([
      new Licenciatura({ name: "Nutricin UdeG" }).save(),
      new Licenciatura({ name: "Psicologa" }).save(),
      new Licenciatura({ name: "Actividad Fsica Deportiva Saludable" }).save(),
      new Licenciatura({ name: "Turismo y Gestin de Proyectos" }).save(),
      new Licenciatura({ name: "Arquitectura" }).save(),
      new Licenciatura({ name: "Ciencias de la Comunicacin" }).save(),
      new Licenciatura({ name: "Contadura Pblica" }).save(),
      new Licenciatura({ name: "Derecho Semiescolarizado" }).save(),
      new Licenciatura({ name: "Diseo para la Comunucacion Grafica" }).save(),
      new Licenciatura({ name: "Diseo Grfico y Digital"}).save(),
      new Licenciatura({ name: "Gatronoma"}).save(),
      new Licenciatura({ name: "Ingenieria en Software"}).save(),
      new Licenciatura({ name: "Mercadotecnia"}).save(),
      new Licenciatura({ name: "Negocios Internacionales"}).save(),
      new Licenciatura({ name: "Administracion Estrategica de los Negocios"}).save(),
      new Licenciatura({ name: " Mercadotecnia Estratgica Escolarizada"}).save(),
      new Licenciatura({ name: "Mercadotecnia Estratgica Mixta"}).save(),

    ]);
    console.log(values);
  } catch (error) {
    console.error(error);
  }
};

createLicenciaturas();

